import React from 'react'
import {BrowserRouter,Route} from 'react-router-dom'
import Header from './Header'


const Router = () => {
    return(
        <BrowserRouter>
        <Header/>
        <Route exact path="/" component={Home}></Route>
        <Route></Route>
        </BrowserRouter>
    )
}
export default Router
